                            value={money}
                            onChange={(e) => setMoney(e.target.value)}
                        /> */}
                    </div>
                    <div>
                        <button onClick={() => toleg()} className="button">
                            Tassykla
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};
export default Money;
